import './App.css';
import Customer from './components/Customer';

const customer = {
  'id':1,
  'img' : 'https://placeimg.com/64/64/any',
  'name' : '김태희',
  'birthday' : '931018',
  'gender' : '남자',
  'job' : '개발'

}

function App() {
  return (
    <Customer
      id={customer.id}
      img={customer.img}
      name={customer.name}
      birthday={customer.birthday}
      gender={customer.gender}
      job = {customer.job}
    />
  );
}

export default App;
